Space Station (IMAX)

Science Documentary hosted by Tom Cruise, published by IMAX in 2002 - English narration


Information
------------------------------

SPACE STATION is the story of this unique partnership of 16 nations building a laboratory in outer space -- a permanent facility for the study of the effects of long-duration exposure to zero gravity and the necessary first step towards the global co-operative effort needed if man is to someday set foot on Mars. It is a story of challenges, setbacks and triumphs?and ultimately, the shared international victory of men and women whose dreams exceed the limits of life on this Earth.
SPACE STATION is the first cinematic journey to the International Space Station (ISS), where audiences can experience for themselves life in zero gravity aboard the new station. Transported by the magic of the IMAX 3D technology, the audience blasts off into space with the astronauts and cosmonauts from Florida's Kennedy Space Center and Russia?s Baikonur Cosmodrome to rendezvous with their new home in orbit 220 miles above Earth. Now people of every age and language can work side by side with their space-walking crewmates, building and inhabiting this unprecedented structure in space.
SPACE STATION is produced and directed by Toni Myers and narrated by Tom Cruise. The Director of Photography and Astronaut Training is James Neihouse. The music is by Micky Erbe and Maribeth Solomon. The Associate Producer is Judy Carroll and the Consulting Producer is Graeme Ferguson.

